import React, { Component } from 'react'
import {
  Typography,
  Grid
} from '@material-ui/core'
import LeftRightGridLayout from './leftRightGridContainer'

class DetailGridView extends Component {


  componentWillReceiveProps(nextProps) {

  }


  render() {
    const { modelData } = this.props
    const {isPlaidSelected} = this.state;

    const plaidVarient = modelData.filter((item) => {
        return (item.variant == 'PLAID');
    })[0];

    const longRangeVariant = modelData.filter((item) => {
        return (item.variant == 'PLAID');
    })[0];

    const selectedVariant = isPlaidSelected ? plaidVarient : longRangeVariant

    return (
    <div class='modelDetailDataContainer'>
        <Typography variant="h5" > Model S Specs</Typography>
        <button class='btn'> Plaid </button>
        <button class='btn'> Long Ranger </button>
        <Grid container>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
            <Grid item>
                <LeftRightGridLayout 
                    leftData={{'title': 'Peak Power', 'value': selectedVariant.range}} 
                    rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/
                >  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
            <Grid item>
                <LeftRightGridLayout leftData={{'title': 'Range', 'value': selectedVariant.range}} rightData={{title: 'Power Train', value: selectedVariant.powertrain}}/>  
            </Grid>
        </Grid>
    </div>

    )
  }
}


export default DetailGridView
